import { useState, useEffect } from "react";

function App() {
  const [loading, setLoading] = useState(true);

  useEffect(()=>{
    fetch('http://www.kobis.or.kr/kobisopenapi/webservice/rest/movie/searchMovieList.json', {
      method: "GET",
      headers: {
        key: '6f20e6b09114441b93d223064bf5017a',
      }
    })
    .then(response => response.json)
    .then(data => console.log(data))
  },[])

  return (
    <div>
      {loading ? <h1>Loading...</h1> : null}
    </div>
  );
}

export default App;
